import * as React from 'react';
import { Link } from 'react-router-dom';
import Breadcrumbs from '@mui/material/Breadcrumbs';
import Typography from '@mui/material/Typography';
import Stack from '@mui/material/Stack';
import NavigateNextIcon from '@mui/icons-material/NavigateNext';
import { useRoutes } from 'react-router-dom';
import { allRoutes } from '../'; // Ajusta la ruta de importación según la ubicación real del archivo

function handleClick(event) {
  event.preventDefault();
  console.info('You clicked a breadcrumb.');
}



export default function Breadcrums() {

    const routes = allRoutes();

//   const routes = [
//     { label: 'MUI', path: '/' },
//     { label: 'Core', path: '/material-ui/getting-started/installation/' },
//     { label: 'Breadcrumb', path: null },
//   ];

  const breadcrumbs = routes.map((route, index) => {
    if (route.path) {
      return (
        <Link
          underline="hover"
          key={index}
          color="inherit"
          to={route.path}
          onClick={handleClick}
        >
          {route.label}
        </Link>
      );
    } else {
      return (
        <Typography key={index} color="text.primary">
          {route.label}
        </Typography>
      );
    }
  });

  return (
    <Stack spacing={2}>
      <Breadcrumbs separator="›" aria-label="breadcrumb">
        {breadcrumbs}
      </Breadcrumbs>
      <Breadcrumbs separator="-" aria-label="breadcrumb">
        {breadcrumbs}
      </Breadcrumbs>
      <Breadcrumbs
        separator={<NavigateNextIcon fontSize="small" />}
        aria-label="breadcrumb"
      >
        {breadcrumbs}
      </Breadcrumbs>
    </Stack>
  );
}
